import { Rings } from 'react-loader-spinner';

const LoadingView = () => (
  <div className="flex justify-center items-center h-full ">
    <Rings
      height={80}
      width={80}
      color="#815854"
      radius="6"
      wrapperStyle={{}}
      wrapperClass=""
      visible={true}
      ariaLabel="rings-loading"
    />
  </div>
);

export default LoadingView;
